DECLARE @UNH55706 TABLE(BF_SSN CHAR(9), DF_SPE_ACC_ID VARCHAR(10), NAME VARCHAR(100), LD_DFR_APL DATE, LD_DFR_BEG DATE, LD_DFR_END DATE)

SELECT 
	U.*,
	CAST(MAX(UheaaImaging.SCAN_DATE) AS DATE) AS ScanDate
FROM 
	@UNH55706 U 
	LEFT OUTER JOIN UHEAA..UHEAA_UHEAA_COMMERCIAL_TAB UheaaImaging
		ON UheaaImaging.SSN = U.BF_SSN
		AND UheaaImaging.DOC_ID = 'LSDEF'
		AND CAST(UheaaImaging.SCAN_DATE AS DATE) <= U.LD_DFR_APL
GROUP BY
	U.BF_SSN,
	U.DF_SPE_ACC_ID,
	U.NAME,
	U.LD_DFR_APL,
	U.LD_DFR_BEG,
	U.LD_DFR_END
ORDER BY
	ScanDate DESC,
	LD_DFR_APL DESC